import { Link } from "react-router-dom";

const Products = () => {
  return (
    <section>
      <h1>The Product Page</h1>
      <ul>
        <li><Link>A Book</Link></li>
        <li>ACarpet</li>
        <li>An Online Course</li>
      </ul>
    </section>
  );
};

export default Products;
